  var firstRun = true;

  Array.prototype.filterMap = function(f){
    var r = new Array();
    for(var i=0;i<this.length;i++){
      var x = f(this[i]);
      if(x!==undefined){
        r.push(x);
      }
    }
    return r;
  }

  function StaticObj3d(mesh){
    return function(addToScope,lookup,removeFromScope){
      return {
        obj:[mesh],
        handle:function(){},
        update:function(){}
      }
    }
  }

  function texPlane(w,h,tex){

    var g = new THREE.PlaneBufferGeometry(w,h);
    var m = new THREE.Mesh(g,
      new THREE.MeshBasicMaterial({
        map:tex
      , transparent:true
      }) );

    m.renderOrder = 1;

    return m;
  }

  var focusFireNearbyState = {callback:function(){}}; // called when near a FF
  function focusFire(duration,target,focusingModifier,returnValue){
    return function(addToScope,lookup,removeFromScope){

      function findRad(c,r){
        function distance(p1,p2){
          return Math.sqrt((p1.x - p2.x)*(p1.x - p2.x) + (p1.y - p2.y)*(p1.y - p2.y) + (p1.z - p2.z)*(p1.z - p2.z));
        }
        var p = distance(c,{x:0,y:0,z:0}) / r;
        return p * r * 0.5;
      }

      var geometry = new THREE.SphereGeometry( 1.0, 6, 6 );
      var material = new THREE.MeshNormalMaterial();
      var sphere = new THREE.Mesh( geometry, material );

      material.visible = false;

      function updateBoundPosition(){

        target.geometry.computeBoundingSphere();

        var x = target.geometry.boundingSphere.center.x + target.position.x;
        var y = target.geometry.boundingSphere.center.y + target.position.y;
        var z = target.geometry.boundingSphere.center.z + target.position.z;

        var r = findRad({
          x:x,
          y:y,
          z:z
        },target.geometry.boundingSphere.radius);

        sphere.scale.set(r,r,r);

        sphere.position.x = x;
        sphere.position.y = y;
        sphere.position.z = z;
      }

      addToScope( StaticObj3d(sphere) );

      var raycaster = new THREE.Raycaster();

      var gaze = new THREE.Vector2();

      gaze.x = 0;
      gaze.y = 0;

      raycaster.near = 0.001;
      raycaster.far = 10;

      var focusingState = {
        ignition:0.0 / 100
      };

      return {
        handle:function(){},
        update:function(time,timeDelta,camera){

          raycaster.setFromCamera( gaze, camera );

          if(raycaster.intersectObject(target,true).length === 1){

            var prev = focusingState.ignition;

            focusingState.ignition += timeDelta / duration;

            if(focusingState.ignition > 1.0){
              focusingState.ignition = 1.0;
            }

            if(prev < 1.0 && focusingState.ignition === 1.0){
              return returnValue === undefined ? true : returnValue;
            }

            focusingModifier(focusingState.ignition,true);

          }else{

            updateBoundPosition();

            if(raycaster.intersectObject(sphere,true).length === 1){
              focusFireNearbyState.callback();
            }

            if(focusingState.ignition > 0.0){

              focusingState.ignition -= timeDelta / duration;

              if(focusingState.ignition < 0.0){
                focusingState.ignition = 0.0;
              }

              focusingModifier(focusingState.ignition,false);

            }
          }

        }
      }
    }
  }

  function groundFloor(scene){

    var geometry = new THREE.BufferGeometry();

    var vertices = new Float32Array(
      [12.0,-0.0,12.0,12.0,-0.0,-12.0,-12.0,-0.0,12.0,-12.0,0.0,-12.0,-12.0,0.0,12.0,12.0,0.0,-12.0]
    );

    geometry.addAttribute( 'position', new THREE.BufferAttribute( vertices, 3 ) );
    geometry.computeVertexNormals();

    var material =
      new THREE.MeshPhongMaterial({
         color:0xfcfcfc
      });

    var mesh = new THREE.Mesh( geometry, material );

    mesh.position.y = -2.0;

    return mesh;
  }

  function addPanel(verts,tex,v){
    return function(addToScope,lookup,removeFromScope){

      var geometry = new THREE.BufferGeometry();
      var vertices = new Float32Array(verts);

      geometry.addAttribute( 'position', new THREE.BufferAttribute( vertices, 3 ) );
      geometry.computeFaceNormals();
      geometry.computeVertexNormals();

      var material =
        new THREE.MeshBasicMaterial( {
          color: interpColor(0.0,babyBlue,0xffffff)
        , transparent:true
        , opacity:0.5
        } );


      var mesh = new THREE.Mesh( geometry, material );
      mesh.renderOrder = 2;

      geometry.computeBoundingSphere();

      var m = texPlane(0.6,0.6,tex);

      m.position.x = geometry.boundingSphere.center.x;
      m.position.y = geometry.boundingSphere.center.y;
      m.position.z = geometry.boundingSphere.center.z;
      m.renderOrder = 3;

      var zdiff = m.position.z - mesh.position.z;

      m.lookAt({x:0,y:0,z:0});

      addToScope(StaticObj3d(m));

      addToScope(animate(200,function(p){
        material.opacity = interp(p,0.0,0.8);
      }));

      var result;

      return {
        obj:[mesh],
        setOpacity:function(x){
          material.opacity = x;
        },handle:function(_){

          addToScope(focusFire(800,mesh,function(p,i){
            material.opacity = i ? 0.3 : 0.8;
            var s = -0.35 * p + 1;
            m.scale.set(s,s,s);
          },v));

          return function(v){

            material.opacity = 0.8;

            var start = Date.now();

            addToScope(animate(400,function(p){
              var s = interp(p,0.85,1.0,Bezier(.33,3.78,.79,1.93));
              m.scale.set(s,s,s);
            }));

            return function(_){

              addToScope(animate(200,function(p){
                var s = interp(p,1.0,0.2);
                m.scale.set(s,s,s);
              }));

              return function(_){
                result = v;
              }
            };
          }
        },
        update:function(){
          m.position.z = zdiff + mesh.position.z;
          if(result !== undefined)return result
        }
      }
    }
  }

