  function addVirtualScreen(choices){
    return function(addToScope,lookup,removeFromScope){

      var zRestingOffset = -0.5;
      var zAnimOffset = 1.0;

      var models = makeGeom(choices.length);

      // screen

      var screenOpacity = 0.5;
      var skeletonOpacity = 0.94;

      var screen = (function(){
        var geometry = new THREE.BufferGeometry();
        var vertices = new Float32Array(
          models[1]
        );

        geometry.addAttribute( 'position', new THREE.BufferAttribute( vertices, 3 ) );
        geometry.computeVertexNormals();

        var material =
        new THREE.MeshBasicMaterial( {
            color: interpColor(0.1,babyBlue,0xffffff)
          , opacity:screenOpacity
          } );

        material.transparent = true;

        var mesh = new THREE.Mesh( geometry, material );
        mesh.position.z = zAnimOffset;

        return mesh;
      })();

      // skeleton

      var skeleton = (function(){
        var geometry = new THREE.BufferGeometry();
        var vertices = new Float32Array(
          models[0]
        );

        geometry.addAttribute( 'position', new THREE.BufferAttribute( vertices, 3 ) );
        geometry.computeVertexNormals();

        var material = new THREE.MeshBasicMaterial( { color: interpColor(0.15,babyBlue,0x0) } );

        material.transparent = true;
        material.side = THREE.BackSide;

        var mesh = new THREE.Mesh( geometry, material );
        mesh.position.z = zAnimOffset;

        return mesh;
      })();

      // panels

      var panels = models[2].map(function(x,i){return addToScope(addPanel(x,choices[i],i))});
      panels.map(lookup).forEach(function(x){
        for(var i=0;i<x.object.obj.length;i++){
          x.object.obj[i].position.z = zAnimOffset;
        }
      });

      addToScope(animate(200,function(p){

        screen.material.opacity = interp(p,0.0,screenOpacity);
        skeleton.material.opacity = interp(p,0.0,skeletonOpacity);

        screen.position.z = interp(p,zAnimOffset,zRestingOffset);
        skeleton.position.z = interp(p,zAnimOffset,zRestingOffset);

        panels.map(lookup).forEach(function(x){
          for(var i=0;i<x.object.obj.length;i++){
            x.object.obj[i].position.z = interp(p,zAnimOffset,zRestingOffset);
          }
        });
      },true));

      var result;

      return {
        obj:[screen,skeleton],
        handle:function(v){

          addToScope(animate(150,function(p){
            function mods(o,m){
              m.material.opacity = interp(p,o,0.0);
              m.position.z = interp(p,zRestingOffset,zAnimOffset);
              m.material.needsUpdate = true;
            }

            mods(screenOpacity,screen);
            mods(skeletonOpacity,skeleton);

            panels.filterMap(lookup).forEach(function($0){mods(0.5,$0.object.obj[0])});
          }));

          return function(_){
            result = v;
          }
        },
        update:function(time,timeDelta,scene){
          if(result !== undefined)return result
        }
      }
    }
  }

  function animate(duration,iteration,silent){
    return function(addToScope,lookup,removeFromScope){

      var s = {
        i:0,
        done:false
      };

      return {
        update:function(_,delta){
          if(s.done){
            return
          }
          s.i = clamp(s.i + (delta / duration),0,1);
          try{iteration(s.i);}catch(e){}finally{

            if(s.i === 1.0 && silent !== true){
              return true;
            }else if(s.i === 1.0 && silent === true){
              s.done = true;
            }
          }
        }
      }
    }
  }

  function lookDown(addToScope,lookup,removeFromScope){

    var geometry = new THREE.PlaneBufferGeometry(2.4,0.6);
    var material = new THREE.MeshBasicMaterial({
          map:textures['lookdown.png']
        , color:0xffffff
        , transparent:true
      });

    var textmesh = new THREE.Mesh(geometry,material);
    var background = new THREE.Mesh(geometry,new THREE.MeshBasicMaterial({
        color:interpColor(0.3,babyBlue,0x0)
      }));

    textmesh.renderOrder = 1;

    function adjust(mesh){
      mesh.position.y = 0.4;
      mesh.position.z = -3;

      mesh.lookAt({x:0,y:0.5,z:0});
    }

    adjust(textmesh);
    adjust(background);

    return {
        obj:[textmesh,background]
      , handle:function(){}
      , update:function(){}
    }
  }

